import React from 'react'
import {
  BrowserRouter as Router,
  Switch,
  Route, 
} from "react-router-dom"

import Users from './pages/Users'


function App() {
  return (
    <Router>
      <Switch>
        <Route path="/usersss">
          <Users/>
        </Route>
      </Switch>
    </Router>
  )
}

export default App
